import React, { useEffect, useState } from "react";
import axios from "axios";

const Weather = () => {
  useEffect(() => {
    axios.get(
      "http://api.weatherapi.com/v1/current.json?key=eedf10149dfd418c9ac161655210101&q=Belfast"
    );
  }, []);
  return <div></div>;
};

export default Weather;
